<vb:comment>
override header bar dropdown triggers using global_palette_accent_01 .
color: main_nav_admin_bar_text_color_hover over background-color: global_palette_accent_01
has poor contrast. Changing either stylevar would have wider impact than just the header 
bar dropdowns. Chosen value #2495FF is based on an initial value of #b1d9ff (.b-post /
userinfo background color), then turning down the brightness until a 3:1 contrast ratio
against the .b-top-menu__background's background color of #F5FFFF was reached.
</vb:comment>
